        id: 19,
        title: 'title19',
        content: 'data19'
    },
    {
        id: 20,
        title: 'title20',
        content: 'data20'
    }
];

  return (
    <>
    <Grid container spacing={10} rowSpacing={1}>
        { tempData.map((item) => (
        <Grid item key={item.id}>
            <Typography >  {item.title} {item.content} </Typography>
        </Grid>
        ))}
    </Grid>
    </>
  );
}

export default MainPage;
